paramConversion.applyStepsToNormalizedParameterValue:
function applyStepsToNormalizedParameterValue(normalizedValue, steps) {
    if (steps == 1) {
        if (normalizedValue > 0) {
            normalizedValue = 1.;
        }
    } else {
        let oneStep = 1. / (steps - 1);
        let numberOfSteps = rnbo_fround(normalizedValue / oneStep * 1 / 1) * 1;
        normalizedValue = numberOfSteps * oneStep;
    }

    return normalizedValue;
}

paramConversion.convertToNormalizedParameterValue:
function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 5:
        {
            value = (value < 0 ? 0 : (value > 20000 ? 20000 : value));
            let normalizedValue = (value - 0) / (20000 - 0);
            return normalizedValue;
        }
    case 1:
    case 3:
        {
            value = (value < 0 ? 0 : (value > 0.5 ? 0.5 : value));
            let normalizedValue = (value - 0) / (0.5 - 0);
            return normalizedValue;
        }
    case 4:
        {
            value = (value < 1 ? 1 : (value > 5 ? 5 : value));
            let normalizedValue = (value - 1) / (5 - 1);
            return normalizedValue;
        }
    case 0:
        {
            value = (value < 20 ? 20 : (value > 10000 ? 10000 : value));
            let normalizedValue = (value - 20) / (10000 - 20);
            return normalizedValue;
        }
    case 2:
        {
            value = (value < 200 ? 200 : (value > 20000 ? 20000 : value));
            let normalizedValue = (value - 200) / (20000 - 200);
            return normalizedValue;
        }
    default:
        return value;
    }
}

paramConversion.convertFromNormalizedParameterValue:
function convertFromNormalizedParameterValue(index, value) {
    value = (value < 0 ? 0 : (value > 1 ? 1 : value));

    switch (index) {
    case 5:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (20000 - 0);
            }
        }
    case 1:
    case 3:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (0.5 - 0);
            }
        }
    case 4:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 1 + value * (5 - 1);
            }
        }
    case 0:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 20 + value * (10000 - 20);
            }
        }
    case 2:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 200 + value * (20000 - 200);
            }
        }
    default:
        return value;
    }
}

paramConversion.constrainParameterValue:
function constrainParameterValue(index, value) {
    var v = value;

    switch (index) {
    case 0:
        {
            v = (v > 10000 ? 10000 : (v < 20 ? 20 : v));
            return v;
        }
    case 1:
        {
            v = (v > 0.5 ? 0.5 : (v < 0 ? 0 : v));
            return v;
        }
    case 2:
        {
            v = (v > 20000 ? 20000 : (v < 200 ? 200 : v));
            return v;
        }
    case 3:
        {
            v = (v > 0.5 ? 0.5 : (v < 0 ? 0 : v));
            return v;
        }
    case 4:
        {
            v = (v > 5 ? 5 : (v < 1 ? 1 : v));
            return v;
        }
    case 5:
        {
            v = (v > 20000 ? 20000 : (v < 0 ? 0 : v));
            return v;
        }
    default:
        return value;
    }
}
